import "./App.css";

import React from "react";

const App = () => {
  const testSubmit = (e) => {
    console.log("submitting!");
    e.preventDefault();
    console.log(e);
  };

  return (
    <div>
      <div>Welcome to Razzle.</div>
      <form onSubmit={testSubmit}>
        <input type="text" name="test" />
        <input type="submit" />
      </form>
    </div>
  );
};

export default App;
